INSERT INTO `catalog_product_entity_text` VALUES (16,85,0,9,'Mô hình 1/100 Destiny Gundam Bandai'),(18,75,0,9,'<style>#html-body [data-pb-style=GH0V4QF]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"GH0V4QF\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;&lt;strong&gt;Mô hình 1/100 Destiny Gundam Bandai&lt;/strong&gt;&lt;/h1&gt;\r\n&lt;p&gt;Sản phẩm Gunpla chính hãng của Bandai, sản xuất tại Nhật Bản.&lt;/p&gt;\r\n&lt;p&gt;PHIÊN BẢN : 1/100&lt;/p&gt;\r\n&lt;p&gt;Chiều cao: 18-23cm&lt;/p&gt;\r\n&lt;p&gt;PHÂN LOẠI SP : LẮP RÁP&lt;/p&gt;\r\n&lt;p&gt;Không kèm đế dựng tuy nhiên bạn có thể mua đế trưng bày với giá rất rẻ ngay tại shop&lt;/p&gt;\r\n&lt;p&gt;Decal dán&lt;/p&gt;\r\n&lt;p&gt;– Sản phậm nhựa cao cấp với độ sắc nét cao&lt;/p&gt;\r\n&lt;p&gt;– Sản xuất bởi Bandai Namco – Nhật Bản Chính hãng&lt;/p&gt;\r\n&lt;p&gt;– An toàn với trẻ em&lt;/p&gt;\r\n&lt;p&gt;– Phát triển trí não cho trẻ hiệu quả đi đôi với niềm vui thích bất tận&lt;/p&gt;\r\n&lt;p&gt;– Rèn luyện tính kiên nhẫn cho người chơi&lt;/p&gt;\r\n&lt;p&gt;– Phân phối bởi TAB Store&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;GIỚI THIỆU CƠ BẢN VỀ GUNDAM&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p&gt;Mô hình gundam (gunpla) là một loại mô hình nhựa được gọi là Model kit, bao gồm nhiều mảnh nhựa rời được gọi là part (bộ phận), khi lắp ráp các part lại với nhau sẽ được mô hình hoàn chỉnh. Các mảnh nhựa rời này được gắn trên khung nhựa gọi là runner.&lt;/p&gt;\r\n&lt;p&gt;Mỗi một hộp sản phẩm Gunpla bao gồm nhiều runner và các phụ kiện liên quan, một tập sách nhỏ (manual) bên trong giới thiệu sơ lược về mẫu Gundam trong hộp và phần hướng dẫn cách lắp ráp. o Dòng gundam với các chi tiết hoàn hảo.&lt;/p&gt;\r\n&lt;p&gt;Các khớp cử động linh hoạt theo ý muốn.&lt;/p&gt;\r\n&lt;p&gt;Người chơi sẽ thỏa sức sáng tạo và đam mê.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;DỤNG CỤ RÁP GUNDAM&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Không chỉ Gundam, chúng ta còn có các phụ kiện và dụng cụ để lắp ráp mô hình Gundam cho bạn như kềm, bút kẻ lằn, bút xóa, dụng cụ sơn, tô… Góp phần tôn vinh vẻ đẹp mô hình Gundam của bạn hơn.&lt;/p&gt;\r\n&lt;p&gt;Cuối cùng, chào mừng bạn đến với thế giới Gundam – TAB Store – Chuyên trang cung cấp thông tin hữu ích nhất về Gunpla tại Việt Nam&lt;/p&gt;\r\n&lt;p&gt;NHẬN ORDER TỪ 7-14 NGÀY ĐỐI VỚI NHỮNG MẶT HÀNG KHÔNG CÓ SẴN&lt;/p&gt;\r\n&lt;p&gt;MỌI CHI TIẾT XIN LIÊN HỆ VỚI CỬA HÀNG TAB Store&amp;nbsp; qua thông tin trên webssite.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;Hình ảnh Mô hình 1/100 Destiny Gundam Bandai&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;&lt;img class=\"alignnone size-full wp-image-9252\" src=\"https://tabmohinh.com/wp-content/uploads/2019/12/M%C3%B4-h%C3%ACnh-1100-Destiny-Gundam-Bandai-1.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-1.jpg 750w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-1-478x400.jpg 478w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-1-510x427.jpg 510w\" alt=\"\" width=\"750\" height=\"628\"&gt;&amp;nbsp;&lt;img class=\"alignnone size-full wp-image-9253\" src=\"https://tabmohinh.com/wp-content/uploads/2019/12/M%C3%B4-h%C3%ACnh-1100-Destiny-Gundam-Bandai-2.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-2.jpg 750w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-2-540x400.jpg 540w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-2-510x378.jpg 510w\" alt=\"\" width=\"750\" height=\"556\"&gt;&amp;nbsp;&lt;img class=\"alignnone size-full wp-image-9254\" src=\"https://tabmohinh.com/wp-content/uploads/2019/12/M%C3%B4-h%C3%ACnh-1100-Destiny-Gundam-Bandai-3.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-3.jpg 750w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-3-323x400.jpg 323w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-3-646x800.jpg 646w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-3-510x632.jpg 510w\" alt=\"\" width=\"750\" height=\"929\"&gt;&amp;nbsp;&lt;img class=\"alignnone size-full wp-image-9255\" src=\"https://tabmohinh.com/wp-content/uploads/2019/12/M%C3%B4-h%C3%ACnh-1100-Destiny-Gundam-Bandai-4.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-4.jpg 750w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-4-445x400.jpg 445w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-4-510x458.jpg 510w\" alt=\"\" width=\"750\" height=\"674\"&gt;&amp;nbsp;&lt;img class=\"alignnone size-full wp-image-9256\" src=\"https://tabmohinh.com/wp-content/uploads/2019/12/M%C3%B4-h%C3%ACnh-1100-Destiny-Gundam-Bandai-5.jpg\" sizes=\"(max-width: 750px) 100vw, 750px\" srcset=\"https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-5.jpg 750w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-5-260x400.jpg 260w, https://tabmohinh.com/wp-content/uploads/2019/12/Mô-hình-1100-Destiny-Gundam-Bandai-5-519x800.jpg 519w, https://tabmohinh.com/wp-content