nt:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"D1KN8EY\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;Mô hình 18086 MINI 4WD Dog Racer (Super-II) Tamiya Tab Store&lt;/h1&gt;\r\n&lt;p id=\"tw-target-text\" class=\"tw-data-text tw-text-large XcVN5d tw-ta\" dir=\"ltr\" data-placeholder=\"Bản dịch\"&gt;&lt;span lang=\"vi\"&gt;Mô hình thân xe lấy cảm hứng từ xe hơi một chỗ ngồi đầy phong cách được đúc màu trắng và kết hợp với một người lái xe shiba-inu đã được lắp ráp trước và sơn màu đáng yêu. Nhãn dán được bao gồm trong bộ để trang trí mô hình và bao gồm một phiên bản cách điệu của ký tự Trung Quốc đại diện cho “shiba” – 柴.&lt;/span&gt;&lt;/p&gt;\r\n&lt;p class=\"tw-data-text tw-text-large XcVN5d tw-ta\" dir=\"ltr\" data-placeholder=\"Bản dịch\"&gt;&lt;span lang=\"vi\"&gt;&nbsp;Khung xe Super-II mang lại độ bền ấn tượng.. Mô hình cũng có công tắc rẽ và điểm gắn đôi cho phía sau. Nhiều lỗ đính kèm cản và ở phía sau cho phép một loạt các tùy chọn thiết lập. Bánh xe 5 chấu chữ V màu trắng kết hợp với lốp hình cung hẹp đường kính lớn, đi kèm hộp số và động cơ 5: 1.&lt;/span&gt;&lt;/p&gt;</div></div></div>'),(41,85,0,20,'MINI 4WD Dog Racer (Super-II) Tamiya'),(42,75,0,21,'<style>#html-body [data-pb-style=UJ5N2LJ]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"UJ5N2LJ\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1 data-placeholder=\"Bản dịch\"&gt;Mô hình 18620 MINI 4WD PRO Thunder ShotMk.II Tamiya TAB Store&lt;/h1&gt;\r\n&lt;p id=\"tw-target-text\" class=\"tw-data-text tw-text-large XcVN5d tw-ta\" dir=\"ltr\" data-placeholder=\"Bản dịch\"&gt;&lt;span lang=\"vi\"&gt;&amp;nbsp;Xe đua Mini 4WD hiệu suất cao này có khung gầm 3 mảnh với phần mũi, phần giữa và phần đuôi để lắp ráp dễ dàng với nhau. Động cơ trục đôi dẫn động cả 4 bánh xe và được đặt ở trung tâm của khung xe với 1 pin mỗi bên giúp cân bằng tuyệt vời. Gắn trên khung gầm này là một thân vỏ tương lai táo bạo với phần vòm tích hợp với mũi và cánh gió sau nhiều bậc. Trên thân xe màu xanh lam này là ký tự màu bạc của Nhật Bản cho “Thunder”, mang lại sự cân bằng màu sắc đẹp mắt với bánh xe đường kính lớn cũng có màu bạc.&lt;/span&gt;&lt;/p&gt;</div></div></div>'),(43,85,0,21,'MINI 4WD PRO Thunder ShotMk.II Tamiya'),(44,75,0,22,'<style>#html-body [data-pb-style=EJTQ96R]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"EJTQ96R\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;Mô hình 18629 MINI 4WD Tridagger XX Tamiya TAB Store&lt;/h1&gt;\r\n&lt;p&gt;mô hình lắp ráp Mini 4WD Pro có&nbsp; Động cơ trục đôi được đặt ở vị trí trung tâm giúp truyền lực hiệu quả đến cả bốn bánh xe để đạt hiệu suất tối ưu. Khung MS ba mảnh không cần keo và dễ lắp ráp. Bạn có thể tận hưởng và nhanh chóng tùy chỉnh thiết lập máy của mình. Chắn bùn trước hình hộp và cánh sau được tạo hình độc đáo, thể hiện chính xác hình dáng mạnh mẽ của Ryo Takaba’s Tridagger&lt;/p&gt;</div></div></div>'),(45,85,0,22,'MINI 4WD Tridagger XX Tamiya'),(46,75,0,23,'<style>#html-body [data-pb-style=N8M1VQR]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N8M1VQR\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;Mô hình 18631 MINI 4WD Spin-Axe Mk.II Tamiya TAB Store&lt;/h1&gt;\r\n&lt;p&gt;Bộ mô hình xe đua&nbsp; Mini 4WD&nbsp; có động cơ trục đôi được đặt ở vị trí trung tâm giúp truyền lực hiệu quả đến cả bốn bánh xe để đạt hiệu suất tối ưu. Khung máy không cần keo và dễ dàng lắp ráp. Bạn sẽ tận hưởng tốc độ nhanh của xe đua này và nhiều lựa chọn cài đặt của nó. Mô hình xe ô tô đua mini 4wd chạy bằng PinAA . Mô hình đã bao gồm các chi tiết và motor&lt;/p&gt;</div></div></div>'),(47,85,0,23,'MINI 4WD Spin-Axe Mk.II Tamiya'),(48,75,0,24,'<style>#html-body [data-pb-style=KH6S4EK]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-backgro