ement=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"VRAFSKU\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;Mô hình 18652 MINI 4WD TS050 Hybrid (PC Body) (MC) Tamiya TAB Store&lt;/h1&gt;\r\n&lt;p&gt;Mô hình xe đua có Khung MA siêu hiệu quả Khung gầm MA (Midship AERO) có động cơ ở trung tâm và có thiết kế tập trung vào việc đạt được hiệu suất khí động học vượt trội. Nó có sáu con lăn ma sát thấp riêng lẻ, một thanh trượt phía sau và các tính năng tốc độ khác được phát triển nhờ nhiều năm kinh nghiệm thiết kế. Khung liền khối một mảnh cũng đảm bảo rằng việc lắp ráp và giữ cho chiếc xe được bảo dưỡng tốt là nhiệm vụ có thể được thực hiện bởi những người mới bắt đầu cũng như những tay đua kỳ cựu. Ở đây, khung MA có tỷ số truyền 3,5: 1.Mô hình xe ô tô đua mini 4wd chạy bằng PinAA.&lt;/p&gt;</div></div></div>'),(57,85,0,28,'MINI 4WD TS050 Hybrid (PC Body) (MC) Tamiya'),(58,75,0,29,'<style>#html-body [data-pb-style=P858OBB]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"P858OBB\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;&lt;strong&gt;Mô hình 1/48 Mega Size Model RX-78-2 Gundam Daban&lt;/strong&gt;&lt;/h1&gt;\r\n&lt;p&gt;Thương Hiệu: Daban&lt;/p&gt;\r\n&lt;p&gt;PHIÊN BẢN : 1/48 tỷ lệ lớn nhất của Gunpla&lt;/p&gt;\r\n&lt;p&gt;Chiều cao: 38cm&lt;/p&gt;\r\n&lt;p&gt;PHÂN LOẠI SP : LẮP RÁP&lt;/p&gt;\r\n&lt;p&gt;Decal dán&lt;/p&gt;\r\n&lt;p&gt;– Sản phậm nhựa cao cấp với độ sắc nét cao&lt;/p&gt;\r\n&lt;p&gt;– An toàn với trẻ em&lt;/p&gt;\r\n&lt;p&gt;– Phát triển trí não cho trẻ hiệu quả đi đôi với niềm vui thích bất tận&lt;/p&gt;\r\n&lt;p&gt;– Rèn luyện tính kiên nhẫn cho người chơi&lt;/p&gt;\r\n&lt;p&gt;– Phân phối bởi TAB Store&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;GIỚI THIỆU CƠ BẢN VỀ GUNDAM&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p&gt;Mô hình gundam (gunpla) là một loại mô hình nhựa được gọi là Model kit, bao gồm nhiều mảnh nhựa rời được gọi là part (bộ phận), khi lắp ráp các part lại với nhau sẽ được mô hình hoàn chỉnh. Các mảnh nhựa rời này được gắn trên khung nhựa gọi là runner.&lt;/p&gt;\r\n&lt;p&gt;Mỗi một hộp sản phẩm Gunpla bao gồm nhiều runner và các phụ kiện liên quan, một tập sách nhỏ (manual) bên trong giới thiệu sơ lược về mẫu Gundam trong hộp và phần hướng dẫn cách lắp ráp. o Dòng gundam với các chi tiết hoàn hảo.&lt;/p&gt;\r\n&lt;p&gt;Các khớp cử động linh hoạt theo ý muốn.&lt;/p&gt;\r\n&lt;p&gt;Người chơi sẽ thỏa sức sáng tạo và đam mê.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;Giới thiệu về cỡ:&nbsp;Mega Size Model (MSM)&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Mega Size Model (MSM) là loại ngoại cỡ đặc biệt 1/48 của các dòng Gundam. Dù là loại lớn nhất nhưng dòng này lại có giá thành rẻ hơn so với PG vì số lượng chi tiết ít hơn. Để thân thiện với người mới chơi thì các chi tiết có thể tách được mà không cần kìm hay một vài runner chế tạo theo kiểu hai nửa chạp lại kiểu “sandwiched” để lắp một cách nhanh chóng. MSM có chứa decal nước.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;DỤNG CỤ RÁP GUNDAM&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Không chỉ Gundam, chúng ta còn có các phụ kiện và dụng cụ để lắp ráp mô hình Gundam cho bạn như kềm, bút kẻ lằn, bút xóa, dụng cụ sơn, tô… Góp phần tôn vinh vẻ đẹp mô hình Gundam của bạn hơn.&lt;/p&gt;\r\n&lt;p&gt;Cuối cùng, chào mừng bạn đến với thế giới Gundam – TAB Store – Chuyên trang cung cấp thông tin hữu ích nhất về Gunpla tại Việt Nam&lt;/p&gt;\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n&lt;p&gt;NHẬN ORDER TỪ 7-14 NGÀY ĐỐI VỚI NHỮNG MẶT HÀNG KHÔNG CÓ SẴN&lt;/p&gt;\r\n&lt;p&gt;MỌI CHI TIẾT XIN LIÊN HỆ VỚI CỬA HÀNG TAB Store&nbsp; qua thông tin trên webssite.&lt;/p&gt;</div></div></div>'),(59,85,0,29,'Mega Size Model RX-78-2 Gundam Daban'),(60,75,0,30,'<style>#html-body [data-pb-style=VNCF4FE]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"VNCF4FE\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;Mô Hình Gundam Daban MG Astray Red Frame 8806&lt;/h1&gt;\r\n&lt;p&gt;Thương Hiệu: Daban&lt;/p&gt;\r\n&lt;p&gt;PHIÊN BẢN : MG 1/100&lt;/p&gt;\r\n&lt;p&gt;Chiều cao: 18-23cm&lt;/p&gt;\r\n&lt;p&gt;PHÂN LOẠI SP : LẮP RÁP&lt;/p&gt;\r\n&lt;p&gt;Decal dán&lt;/p&gt;\r\n&lt;p&gt;– Sản phẩm nhựa cao cấp với độ sắc nét cao&lt;/p&gt;\r\n&lt;p&gt;– An toàn với trẻ em&lt;/p&gt;\r\n&lt;p&gt;– Phát triển trí não IQ cho trẻ hiệu quả đi đôi với niềm vui thích bất tận&lt;/p&gt;\r\n&lt;p&gt;– Kích thích trí tưởng tượng không gian hình học và tính logic cho trẻ&lt;/p&gt;\r\n&lt;p&gt;– Rèn luyện tính kiên nhẫn, tỉ mỉ, cẩn thận và tự lập cho người chơi&lt;/p&gt;\r\n&lt;p&gt;– Tránh cho trẻ thường xuyên sử dụng điện thoại&lt;/p&gt;\r\n&lt;p&gt;– Phân phối bởi TAB Store&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;GIỚI THIỆU CƠ BẢN VỀ GUNDAM&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p&gt;Mô hình gundam (gunpla) là một loại mô hình nhựa được gọi là Model kit, bao gồm nhiều mảnh nhựa rời được gọi là part (bộ phận), khi lắp ráp các part lại với nhau sẽ được mô hình hoàn chỉnh. Các mảnh nhựa rời này được gắn trên khung nhựa gọi là runner.&lt;/p&gt;\r\n&lt;p&gt;Mỗi một hộp sản phẩm Gunpla bao gồm nhiều runner và các phụ kiện liên quan, một tập sách nhỏ (manual) bên trong giới thiệu sơ lược về mẫu Gundam trong hộp và phần hướng dẫn cách lắp ráp. o Dòng gundam với các chi tiết hoàn hảo.&lt;/p&gt;\r\n&lt;p&gt;Các khớp cử động linh hoạt theo ý muốn.&lt;/p&gt;\r\n&lt;p&gt;Người chơi sẽ thỏa sức sáng tạo và đam mê.&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;Giới thiệu về cỡ: Master Grade (MG)&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p dir=\"ltr\"&gt;MG (Master Grade) là dòng Gunpla cỡ 1/100 được sản xuất lần đầu vào lễ kỷ niệm Gundam lần thứ 15. Dòng MG khác với dòng 1/100 ở chi tiết, khớp nối và tỉ lệ chỉ kém hơn dòng PG. Tất cả các dòng MG đều có hệ thống khung xương bên trong và một vài mẫu có thể lắp đèn LED để tăng độ ảo diệu. Để người xem có thể hình dung được cỡ của gundam so với người thì rất nhiều mẫu MG có chứa cỡ 1/100 của phi công điều khiển. Một vài mẫu có cỡ 1/20 của phi công.&nbsp;Đầu năm 2002 mecha designer Hajime Katoki bắt đầu thiết kế lại hàng loạt Mobile Suits và ra mắt chúng trong dòng Master Grade dưới tên gọi ‘’Ver.Ka’’ (Katori Version). Hầu hết các phiên bản Ver.ka được sản xuất là do kết quả bình chọn của fan hàng năm.&nbsp;Ngoài gundam ra thì một số phim mecha và anime nổi tiếng khác cũng được sản xuất cỡ MG như Dragon Ball Z, One Piece.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;DỤNG CỤ RÁP GUNDAM&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Không chỉ Gundam, chúng ta còn có các phụ kiện và dụng cụ để lắp ráp mô hình Gundam cho bạn như kềm, bút kẻ lằn, bút xóa, dụng cụ sơn, tô… Góp phần tôn vinh vẻ đẹp mô hình Gundam của bạn hơn.&lt;/p&gt;\r\n&lt;p&gt;Cuối cùng, chào mừng bạn đến với thế giới Gundam – TAB Store – Chuyên trang cung cấp thông tin hữu ích nhất về Gunpla tại Việt Nam&lt;/p&gt;\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n&lt;p&gt;NHẬN ORDER TỪ 7-14 NGÀY ĐỐI VỚI NHỮNG MẶT HÀNG KHÔNG CÓ SẴN&lt;/p&gt;\r\n&lt;p&gt;MỌI CHI TIẾT XIN LIÊN HỆ VỚI CỬA HÀNG TAB Store&nbsp; qua thông tin trên website.&lt;/p&gt;\r\n&lt;p&gt;TAB Store- Vì một trí tuệ Việt Nam&lt;/p&gt;</div></div></div>'),(61,85,0,30,'Gundam Daban MG Astray Red Frame 8806'),(62,75,0,31,'<style>#html-body [data-pb-style=N91LS8O]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"N91LS8O\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;&lt;strong&gt;Mô hình Bandai Gundam MG PLAN303E Deep Striker&lt;/strong&gt;&lt;/h1&gt;\r\n&lt;p&gt;Sản phẩm Gunpla chính hãng của Bandai, sản xuất tại Nhật Bản.&lt;/p&gt;\r\n&lt;p&gt;PHIÊN BẢN : MG&lt;/p&gt;\r\n&lt;p&gt;Chiều cao: 18-23cm&lt;/p&gt;\r\n&lt;p&gt;PHÂN LOẠI SP : LẮP RÁP&lt;/p&gt;\r\n&lt;p&gt;Decal dán&lt;/p&gt;\r\n&lt;p&gt;– Sản phậm nhựa cao cấp với độ sắc nét cao&lt;/p&gt;\r\n&lt;p&gt;– Sản xuất bởi Bandai Namco – Nhật Bản Chính hãng&lt;/p&gt;\r\n&lt;p&gt;– An toàn với trẻ em&lt;/p&gt;\r\n&lt;p&gt;– Phát triển trí não cho trẻ hiệu quả đi đôi với niềm vui thích bất tận&lt;/p&gt;\r\n&lt;p&gt;– Rèn luyện tính kiên nhẫn cho người chơi&lt;/p&gt;\r\n&lt;p&gt;– Phân phối bởi TAB Store&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;GIỚI THIỆU CƠ BẢN VỀ GUNDAM&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p&gt;Mô hình gundam (gunpla) là một loại mô hình nhựa được gọi là Model kit, bao gồm nhiều mảnh nhựa rời được gọi là part (bộ phận), khi lắp ráp các part lại với nhau sẽ được mô hình hoàn chỉnh. Các mảnh nhựa rời này được gắn trên khung nhựa gọi là runner.&lt;/p&gt;\r\n&lt;p&gt;Mỗi một hộp sản phẩm Gunpla bao gồm nhiều runner và các phụ kiện liên quan, một tập sách nhỏ (manual) bên trong giới thiệu sơ lược về mẫu Gundam trong hộp và phần hướng dẫn cách lắp ráp. o Dòng gundam với các chi tiết hoàn hảo.&lt;/p&gt;\r\n&lt;p&gt;Các khớp cử động linh hoạt theo ý muốn.&lt;/p&gt;\r\n&lt;p&gt;Người chơi sẽ thỏa sức sáng tạo và đam mê.&lt;/p&gt;\r\n&lt;h3&gt;&lt;strong&gt;Giới thiệu về cỡ: Master Grade (MG)&lt;/strong&gt;&lt;/h3&gt;\r\n&lt;p dir=\"ltr\"&gt;MG (Master Grade) là dòng Gunpla cỡ 1/100 được sản xuất lần đầu vào lễ kỷ niệm Gundam lần thứ 15. Dòng MG khác với dòng 1/100 ở chi tiết, khớp nối và tỉ lệ chỉ kém hơn dòng PG. Tất cả các dòng MG đều có hệ thống khung xương bên trong và một vài mẫu có thể lắp đèn LED để tăng độ ảo diệu. Để người xem có thể hình dung được cỡ của gundam so với người thì rất nhiều mẫu MG có chứa cỡ 1/100 của phi công điều khiển. Một vài mẫu có cỡ 1/20 của phi công.&nbsp;Đầu năm 2002 mecha designer Hajime Katoki bắt đầu thiết kế lại hàng loạt Mobile Suits và ra mắt chúng trong dòng Master Grade dưới tên gọi ‘’Ver.Ka’’ (Katori Version). Hầu hết các phiên bản Ver.ka được sản xuất là do kết quả bình chọn của fan hàng năm.&nbsp;Ngoài gundam ra thì một số phim mecha và anime nổi tiếng khác cũng được sản xuất cỡ MG như Dragon Ball Z, One Piece.&lt;/p&gt;\r\n&lt;h2&gt;&lt;strong&gt;DỤNG CỤ RÁP GUNDAM&lt;/strong&gt;&lt;/h2&gt;\r\n&lt;p&gt;Không chỉ Gundam, chúng ta còn có các phụ kiện và dụng cụ để lắp ráp mô hình Gundam cho bạn như kềm, bút kẻ lằn, bút xóa, dụng cụ sơn, tô… Góp phần tôn vinh vẻ đẹp mô hình Gundam của bạn hơn.&lt;/p&gt;\r\n&lt;p&gt;Cuối cùng, chào mừng bạn đến với thế giới Gundam – TAB Store – Chuyên trang cung cấp thông tin hữu ích nhất về Gunpla tại Việt Nam&lt;/p&gt;\r\n&lt;p&gt;&nbsp;&lt;/p&gt;\r\n&lt;p&gt;NHẬN ORDER TỪ 7-14 NGÀY ĐỐI VỚI NHỮNG MẶT HÀNG KHÔNG CÓ SẴN&lt;/p&gt;\r\n&lt;p&gt;MỌI CHI TIẾT XIN LIÊN HỆ VỚI CỬA HÀNG TAB Store&nbsp; qua thông tin trên webssite.&lt;/p&gt;</div></div></div>'),(63,85,0,31,'Bandai Gundam MG PLAN303E Deep Striker'),(64,85,0,32,'Mô Hình Bandai Gundam MG Buster GAT X103'),(65,76,0,32,'<h1><strong>Mô Hình Bandai Gundam MG Buster GAT X103</strong></h1>\r\n<p>Sản phẩm Gunpla chính hãng của Bandai, sản xuất tại Nhật Bản.</p>\r\n<p>PHIÊN BẢN : MG</p>\r\n<p>Chiều cao: 18-23cm</p>\r\n<p>PHÂN LOẠI SP : LẮP RÁP</p>\r\n<p>Decal dán</p>\r\n<p>– Sản phẩm nhựa cao cấp với độ sắc nét cao</p>\r\n<p>– An toàn với trẻ em</p>\r\n<p>– Phát triển trí não IQ cho trẻ hiệu quả đi đôi với niềm vui thích bất tận</p>\r\n<p>– Kích thích trí tưởng tượng không gian hình học và tính logic cho trẻ</p>\r\n<p>– Rèn luyện tính kiên nhẫn, tỉ mỉ, cẩn thận và tự lập cho người chơi</p>\r\n<p>– Tránh cho trẻ thường xuyên sử dụng điện thoại</p>\r\n<p>– Phân phối bởi TAB Store- Vì một trí tuệ Việt Nam</p>'),(66,75,0,33,'<style>#html-body [data-pb-style=V59GN6I]{justify-content:flex-start;display:flex;flex-direction:column;background-position:left top;background-size:cover;background-repeat:no-repeat;background-attachment:scroll}</style><div data-content-type=\"row\" data-appearance=\"contained\" data-element=\"main\"><div data-enable-parallax=\"0\" data-parallax-speed=\"0.5\" data-background-images=\"{}\" data-background-type=\"image\" data-video-loop=\"true\" data-video-play-only-visible=\"true\" data-video-lazy-load=\"true\" data-video-fallback-src=\"\" data-element=\"inner\" data-pb-style=\"V59GN6I\"><div data-content-type=\"html\" data-appearance=\"default\" data-element=\"main\">&lt;h1&gt;&lt;strong&gt;Mô Hình Bandai Gundam MG Buster GAT X103&lt;/strong&gt;&lt;/h1&gt;\r\n&lt;p&gt;Sản phẩm Gunpla chính hãng của Bandai, sản xuất tại Nhật Bản.&lt;/p&gt;\r\n&lt;p&gt;PHIÊN BẢN : MG&lt;/p&gt;\r\n&lt;p&gt;Chiều cao: 18-23cm&lt;/p&gt;\r\n&lt;p&gt;PHÂN LOẠI SP : LẮP RÁP&lt;/p&gt;\r\n&lt;p&gt;Decal dán&lt;/p&gt;\r\